import styled from 'styled-components'

export const CardStyle = styled.div`

    .card {
        background: #1E212A;
        width: 365px;
        height: 145px;
        margin-left: 100px;
        display: flex;
        border-radius: 15px; 
        justify-content: space-between;
    }

    .image {
        width: 115px;
        height: 115px;
        background: black;
        margin-top: 12px;
        margin-left: 12px;
    }

    .infos {
        margin-right: 115px;
        display: flex;
        flex-direction: column;
        justify-content: space-evenly;
    }

    p {
        margin: 0;
        color: #ffff;
        font-weight: 500;
    }


`
